// StudentDetails.js
import React, { useState, useEffect } from 'react';
import './StudentDetails.css';
import { generatePath, useNavigate } from 'react-router-dom';


const StudentDetails = ({ email }) => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    email: '',
    studentid: '',
    firstname: '',
    lastname: '',
    gpa: '',
    major: ''
  });

  useEffect(() => {
    setFormData(prev => ({ ...prev, email }));  // Pre-fill email from props
  }, [email]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
  e.preventDefault();
  // Optional: validate or POST to backend here
  console.log('Submitted student data:', formData);
  // Redirect to login
  navigate('/', { state: { openLogin: true } });  // Update this path based on your actual route
};

  return (
    <div className="student-details-wrapper">
      <div className="student-details-container">
        <h2>Complete Your Student Profile</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Email:</label>
            <input type="email" name="email" value={formData.email} disabled />
          </div>
          <div className="form-group">
            <label>firstname:</label>
            <input type="text" firstname="firstname" value={formData.firstname} onChange={handleChange} required />
          </div>
          <div className="form-group">
            <label>lastname:</label>
            <input type="text" name="lastname" value={formData.lastname} onChange={handleChange} required />
          </div>
          <div className="form-group">
            <label>gpa:</label>
            <input type="number" name="gpa" value={formData.gpa} onChange={handleChange} required />
          </div>
          <div className="form-group">
            <label>major:</label>
            <input type="text" name="major" value={formData.major} onChange={handleChange} required />
          </div>
          <div className="form-group">
            <label>Course:</label>
            <input type="text" name="course" value={formData.course} onChange={handleChange} required />
          </div>
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default StudentDetails;
